angular.module("inventoryApp").controller('inventoryCtrl', ['$scope', '$q', '$uibModal', '$timeout', 'inventoryFactory', 'utilsFactory', 'utilsServices', 'SweetAlert', 'Upload', function ($scope, $q, $modal, $timeout, inventoryFactory, utilsFactory, utilsServices, SweetAlert, Upload) {

    $scope.utilsServices = utilsServices;

    $scope.inventoryFactory = inventoryFactory;

    $scope.progressPercentage = 0;

    $scope.autocompleteOptions = {
        componentRestrictions: {country: 'us'},
        types: ['geocode']
    };

    $scope.inventorySearch = '';

    $scope.inventoryStatusList = [];

    $scope.inventoryList = [];

    $scope.inventoryUpload = '';

    $scope.search = {
        name: '',
        sku: '',
        quantity: '',
        price: '',
        condition: '',
        circa: '',
        era: '',
        style: '',
        material: '',
        category: '',
        sub_category: '',
        year_made: '',
        origin: '',
        description: '',
        height: '',
        length: '',
        width: '',
        weight: '',
        radius: '',
        media: [],
        tags: []
    };

    $scope.slickConfig = {
        enabled: true,
        autoplay: false,
        draggable: true
    };

    /**
     * Reset Search
     */
    $scope.resetSearch = function () {
        $scope.search = {
            name: '',
            sku: '',
            quantity: '',
            price: '',
            condition: '',
            circa: '',
            era: '',
            style: '',
            material: '',
            category: '',
            sub_category: '',
            year_made: '',
            origin: '',
            description: '',
            height: '',
            length: '',
            width: '',
            weight: '',
            radius: '',
            media: [],
            tags: []
        };
    };


    $scope.importInventoryOpen = function () {
        $scope.progressPercentage = 0;

        $scope.importInventoryModal = $modal.open({
            templateUrl: 'importInventoryModal.html',
            scope: $scope,
            windowClass: ''
        });

        $scope.importInventoryModal.rendered.then(function () {
            $timeout(function () {

            });
        });
    };


    /**
     * Close dashboard modal
     */
    $scope.importInventoryClose = function () {
        $scope.importInventoryModal.dismiss('cancel');
        $scope.progressPercentage = 0;

    };

    /**
     * Upload Media to AWS
     */
    $scope.uploadInventoryZip = function (file, errFiles) {

        $scope.progressPercentage = 0;

        this.f = file;

        this.errFile = errFiles && errFiles[0];

        if (file) {
            Upload.upload({
                url: '/dashboard/api/v1/inventory/import',
                method: 'put',
                data: {
                    file: file
                }
            }).then(function (resp) {
                $timeout(function () {

                    var response = $scope.utilsServices.processObjectValue(resp.data, 'response');

                    _this.processResponse(response);
                    /**
                     * If everything is then we will get inventory ID.
                     */
                    if (response.status == "success") {
                        $scope.getInventory();
                    }

                });
            }, null, function (evt) {
                // $scope.progressPercentage = evt.loaded;
                $scope.progressPercentage = parseInt(100.0 * evt.loaded / evt.total);
                // $scope.log = 'progress: ' + progressPercentage + '% ' + evt.config.data.file.name + '\n' + $scope.log;
            });
        }
    };


    $scope.openImage = function (image) {
        $scope.inventoryImage = angular.copy(image);

        $scope.imageViewModal = $modal.open({
            templateUrl: 'imageViewModal.html',
            scope: $scope,
            size: 'md',
            windowClass: ''
        });

        $scope.imageViewModal.rendered.then(function () {
            $timeout(function () {

            });
        });
    };


    /**
     * Close dashboard modal
     */
    $scope.closeImage = function () {
        $scope.imageViewModal.dismiss('cancel');
    };


    /**
     * Get inventory dashboard list from admin api.
     */
    $scope.getInventory = function (inventoryStatus) {

        if (_.isUndefined(inventoryStatus)) {
            inventoryStatus = 'draft';
        }

        $scope.inventoryList = [];

        $scope.inventoryFactory.APIDashboardInventory({
            name: $scope.utilsServices.processObjectValue($scope.search, 'name'),
            sku: $scope.utilsServices.processObjectValue($scope.search, 'sku'),
            quantity: $scope.utilsServices.processObjectValue($scope.search, 'quantity'),
            price: $scope.utilsServices.processObjectValue($scope.search, 'price'),
            condition: $scope.utilsServices.processObjectValue($scope.search, 'condition.id'),
            shipping_method: $scope.utilsServices.processObjectValue($scope.search, 'shipping_method.id'),
            circa: $scope.utilsServices.processObjectValue($scope.search, 'circa.id'),
            era: $scope.utilsServices.processObjectValue($scope.search, 'era.id'),
            style: $scope.utilsServices.processObjectValue($scope.search, 'style.id'),
            material: $scope.utilsServices.processObjectValue($scope.search, 'material.id'),
            category: $scope.utilsServices.processObjectValue($scope.search, 'category.id'),
            sub_category: $scope.utilsServices.processObjectValue($scope.search, 'sub_category.id'),
            origin: $scope.utilsServices.processObjectValue($scope.search, 'origin'),
            description: $scope.utilsServices.processObjectValue($scope.search, 'description'),
            height: $scope.utilsServices.processObjectValue($scope.search, 'height'),
            length: $scope.utilsServices.processObjectValue($scope.search, 'length'),
            width: $scope.utilsServices.processObjectValue($scope.search, 'width'),
            weight: $scope.utilsServices.processObjectValue($scope.search, 'weight'),
            diameter: $scope.utilsServices.processObjectValue($scope.search, 'diameter'),
            tags: $scope.utilsServices.processList($scope.search.tags, 'text'),
            status: $scope.utilsServices.processObjectValue(inventoryStatus),
            search: $scope.utilsServices.processObjectValue($scope.inventorySearch),
            page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'pageNumber', 1),
            per_page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'numPerPage', 20)
        }).then(function (data) {
            $scope.inventoryList = data.inventory;
            $scope.inventoryMetadata = data.metadata;
            $scope.inventoryTable = $scope.utilsServices.tableObject($scope.inventoryList, data.pagination);
        });
    };

    /**
     * Get all dashboard account status
     */
    $scope.getInventoryStatus = function () {
        $scope.inventoryFactory.APIDashboardInventoryStatus().then(function (data) {
            $scope.inventoryStatusList = data.statuses;
        });
    };


    /**
     * Get all dashboard account status
     */
    $scope.getPrimaryImage = function (inventory) {

        var primaryMedia = _.find(inventory.media, function (media) {
            return media.is_primary;
        });

        if (!_.isUndefined(primaryMedia)) {
            return primaryMedia.url;
        }
        else {
            return null
        }
    };

    /**
     * Get dashboard account status names
     * @param category_id
     * @returns {*}
     */
    $scope.getInventoryStatusName = function (status_id) {
        var status = _.find($scope.inventoryStatusList, {'id': status_id});

        if (!_.isUndefined(status)) {
            return status.url
        }
    };

    /**
     * Delete inventory
     */
    $scope.deleteInventory = function (inventory) {

        SweetAlert.swal({
                title: "Are you sure?",
                text: 'You cannot undo this, this inventory will be removed from your account.',
                timer: 30000,
                type: "warning",
                showCancelButton: true,
                confirmButtonText: "Yes"
            },
            function (isConfirm) {
                if (isConfirm) {
                    $scope.inventoryFactory.APIDashboardInventoryDelete({
                        inventory_id: $scope.utilsServices.processObjectValue(inventory.id)
                    }).then(function (data) {
                        $scope.utilsServices.processResponse(data.response);
                        if (data.response.status === "success") {
                            $scope.getInventory();
                        }
                    });
                }
            });
    };


    /**
     * Get inventory categories
     */
    $scope.getInventoryCategory = function (search) {
        $scope.inventoryFactory.APIDashboardInventoryCategory({
            search: $scope.utilsServices.processObjectValue(search),
            page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'pageNumber', 1),
            per_page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'numPerPage', 25)
        }).then(function (data) {
            $scope.inventoryCategoryList = data.categories;
        });
    };


    /**
     * Get inventory style
     */
    $scope.getInventoryStyle = function (search) {
        $scope.inventoryFactory.APIDashboardInventoryStyle({
            search: $scope.utilsServices.processObjectValue(search),
            page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'pageNumber', 1),
            per_page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'numPerPage', 25)
        }).then(function (data) {
            $scope.inventoryStyleList = data.styles;
        });
    };

    /**
     * Get inventory material
     */
    $scope.getInventoryMaterial = function (search) {
        $scope.inventoryFactory.APIDashboardInventoryMaterial({
            search: $scope.utilsServices.processObjectValue(search),
            page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'pageNumber', 1),
            per_page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'numPerPage', 25)
        }).then(function (data) {
            $scope.inventoryMaterialList = data.materials;
        });
    };

    /**
     * Get shipping methods
     */
    $scope.getInventoryShipping = function () {
        $scope.inventoryFactory.APIDashboardInventoryShippingMethod({
            search: $scope.utilsServices.processObjectValue($scope.inventorySearch),
            page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'pageNumber', 1),
            per_page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'numPerPage', 10)
        }).then(function (data) {
            $scope.inventoryShippingList = data.shipping_methods;
        });
    };


    /**
     * Get inventory sub-categories
     */
    $scope.getInventorySubCategory = function (search) {
        if ($scope.utilsServices.processObjectValue($scope.inventory, 'category.id')) {
            $scope.inventoryFactory.APIDashboardInventorySubCategory({
                category_id: $scope.utilsServices.processObjectValue($scope.inventory.category, 'id'),
                search: $scope.utilsServices.processObjectValue(search),
                page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'pageNumber', 1),
                per_page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'numPerPage', 25)
            }).then(function (data) {
                /**
                 * reset sug category when we get new list.
                 * @type {null}
                 */
                $scope.inventory.sub_category = null;
                $scope.inventorySubCategoryList = data.sub_categories;
            });
        }
    };

    /**
     * Get inventory circa
     */
    $scope.getInventoryCirca = function () {
        $scope.inventoryFactory.APIDashboardInventoryCirca({
            page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'pageNumber', 1),
            per_page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'numPerPage', 10)
        }).then(function (data) {
            $scope.inventoryCircaList = data.circa;

        });
    };

    /**
     * Get inventory era
     */
    $scope.getInventoryEra = function () {
        $scope.inventoryFactory.APIDashboardInventoryEra({
            page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'pageNumber', 1),
            per_page: $scope.utilsServices.processObjectValue($scope.inventoryTable, 'numPerPage', 10)
        }).then(function (data) {
            $scope.inventoryEraList = data.era;
        });
    };

    /**
     * Get inventory condition list
     */
    $scope.getInventoryCondition = function () {
        $scope.inventoryFactory.APIDashboardInventoryCondition().then(function (data) {
            $scope.inventoryConditionList = data.conditions;
        });
    };


    /**
     * execute after service is ready with data.
     */
    $scope.$watch(function () {
        return $scope.utilsServices.memberProfile;
    }, function (newValue, oldValue) {

        if (newValue !== oldValue) {
            $scope.getInventory();
            $scope.getInventoryStatus();
            $scope.getInventoryCategory();
            $scope.getInventoryCondition();
            $scope.getInventoryCirca();
            $scope.getInventoryEra();
            $scope.getInventoryShipping();
            $scope.getInventoryStyle();
            $scope.getInventoryMaterial();
        }
    });
}]);

