    /**
     * Upload Media to AWS
     */
    $scope.uploadMedia = function (files) {
        if (files && files.length) {
            for (var i = 0; i < files.length; i++) {
                var file = files[i];
                if (!file.$error) {
                    Upload.upload({
                        url: '/dashboard/api/v1/inventory/media',
                        method: 'put',
                        data: {
                            file: file,
                            inventory_id: $scope.inventory.id
                        }
                    }).then(function (resp) {
                        $timeout(function () {
                            $scope.log = 'file: ' +
                                resp.config.data.file.name +
                                ', Response: ' + JSON.stringify(resp.data) +
                                '\n' + $scope.log;

                            /**
                             * Process response.
                             * @type {null}
                             */
                            var response = utilsServices.processObjectValue(resp.data, 'response');

                            $scope.utilsServices.processResponse(response);

                            /**
                             * If everything is then we will get inventory ID.
                             */
                            if (response.status == "success") {

                                $scope.getInventory();
                            }

                        });
                    }, null, function (evt) {
                        // var progressPercentage = parseInt(100.0 * evt.loaded / evt.total);
                        // $scope.log = 'progress: ' + progressPercentage + '% ' + evt.config.data.file.name + '\n' + $scope.log;
                    });
                }
            }
        }
    };

