    $scope.$watch('inventory.price', function () {
        if ($scope.utilsServices.accountProfile.trade_discount > 0) {
            $scope.inventory.trade_price = parseInt($scope.inventory.price - parseFloat(($scope.utilsServices.accountProfile.trade_discount / 100) * $scope.inventory.price));
        }
        else {
            $scope.inventory.trade_price = parseInt(($scope.inventory.price));
        }
    });


